window.bookSummaryJSON = "<p>The Dungeon is a place of magic and mystery, a vast branching, underground labyrinth that has changed the world and the people who dare to enter its depths. Those who brave its challenges are rewarded with wealth, fame, and powerful classes that set them apart from the rest.</p> <p>Ken was determined to follow the footsteps of his family and become one of the greatest adventurers the world has ever known. He knows that the only way to do that is to get into one of the esteemed Dungeon colleges, where the most promising young adventurers gather.</p> <p>Despite doing fantastic on the entrance exam, when his class is revealed, everyone turns their backs on him, all except for one.</p> <p>The most powerful adventurer, Crimson, invites him to the one college he never thought heâ€™d enter. Haylon, an all girls college.</p> <p>Ken sets out to put together a party and master the skills he'll need to brave the Dungeon's endless dangers. But he soon discovers that the path ahead is far more perilous than he could have ever imagined.</p>"; 
